angular.module("liaoyuan",[]).controller("urlController",function(a,b){a.load=function(){b.get("/api/url").success(function(b,c){console.log(b),a.urls=b}).error(function(a,b){console.log(b,a)})},a.shorten=function(){var c=a.originalURL;b.post("/api/url",{originalURL:c}).success(function(b,c){a.load(),a.newURL=b}).error(function(a,b){console.log(b,a)})}});